import React, { useState, useEffect } from 'react';
import './css/Join.css';
import axios from 'axios';
import { getCookie } from './utils/cookie';

const MyPage = () => {

  useEffect(() => {
    console.log('멤버 계정 상태 가져오는 중...');
    const memberAccountStatus = async () => {
      try {
        const requestData = {
          memberId: getCookie('memberId'),
        };

        const response = await axios
          .post('/myaccount', requestData);
          const responseData = response.data.result;

          console.log('응답 데이터:', response.data.result.memberId);

        setFormData({
          memberEmailId: responseData.memberEmailId,
          memberEmailAddress: responseData.memberEmailAddress,
          memberId: responseData.memberId,
          memberPhone1: responseData.memberPhone1,
          memberPhone2: responseData.memberPhone2,
          memberPhone3: responseData.memberPhone3,
          address: {
            memberPostalCode: responseData.address.memberPostalCode,
            memberPostAddress: responseData.address.memberPostAddress,
            memberDetailedAddress: responseData.address.memberDetailedAddress,
          },
        });
      } catch (error) {
        console.error('Error fetching user data:', error);
      }
    };
    memberAccountStatus();
  }, []); 

  const [formData, setFormData] = useState({
    memberEmailId: '',
    memberEmailAddress: '',
    memberId: '',
    memberPhone1: '',
    memberPhone2: '',
    memberPhone3: '',
    address: {
      memberPostalCode: '',
      memberPostAddress: '',
      memberDetailedAddress: '',
    },
  });

  const resetFormData = () => {
    setFormData({
      memberEmailId: '',
      memberEmailAddress: '',
      memberId: '',
      memberPhone1: '',
      memberPhone2: '',
      memberPhone3: '',
      address: {
        memberPostalCode: '',
        memberPostAddress: '',
        memberDetailedAddress: '',
      },
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('join form data:', formData);
    // send data
  };

  const handlePasswordUpdate = () => {
    // send data
    console.log('PASSWORD UPDATE BUTTON CLICK');
  };

  const handleGoBack = () => {
    // send data
    console.log('GO BACK BUTTON CLICK');
  };

  const memberAccountUpdatePage = () => {
    // send data
    console.log('memberAccountUpdatePage BUTTON CLICK');
  };

  return (
    <div className="app-container">
      <form onSubmit={handleSubmit}>
        <table className="app-container">
          <thead>
            <tr>
              <th colSpan="2">※MY ACCOUNT</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <th>ID</th>
              <td>
                <input
                  type="text"
                  name="memberId"
                  value={formData.memberId}
                  readOnly
                />
              </td>
            </tr>
            <tr>
              <th>E-MAIL</th>
              <td>
                <input
                  type="text"
                  name="memberEmailId"
                  value={formData.memberEmailId}
                  readOnly
                />
                <span className="sign">@</span>
                <input
                  type="text"
                  name="memberEmailAddress"
                  value={formData.memberEmailAddress}
                  readOnly
                />
              </td>
            </tr>
            <tr>
              <th>PASSWORD</th>
              <td>
                <button type="button" onClick={handlePasswordUpdate}>
                  PWUPDATE
                </button>
              </td>
            </tr>
            <tr>
              <th>PHONE NUMBER</th>
              <td>
                <input
                  type="text"
                  name="memberPhone1"
                  value={formData.memberPhone1}
                  readOnly
                />
                <span className="sign"></span>
                <span className="sign">-</span>
                <input
                  type="text"
                  name="memberPhone2"
                  value={formData.memberPhone2}
                  readOnly
                />
                <span className="sign"></span>
                <span className="sign">-</span>
                <input
                  type="text"
                  name="memberPhone3"
                  value={formData.memberPhone3}
                  readOnly
                />
              </td>
            </tr>
            <tr>
              <th row rowSpan={3}>
                ADDRESS
              </th>
              <td>
                <input
                  type="text"
                  name="address.memberPostalCode"
                  placeholder="POSTAL CODE"
                  value={formData.address.memberPostalCode}
                  readOnly
                />
                <span className="sign"></span>
              </td>
            </tr>
            <tr>
              <td>
                <input
                  type="text"
                  name="address.memberPostAddress"
                  placeholder="POST ADDRESS"
                  value={formData.address.memberPostAddress}
                  readOnly
                />
              </td>
            </tr>
            <tr>
              <td>
                <input
                  type="text"
                  name="address.memberDetailedAddress"
                  placeholder="DETAILED ADDRESS"
                  value={formData.address.memberDetailedAddress}
                  readOnly
                />
              </td>
            </tr>
          </tbody>
        </table>
        <button
          type="submit"
          onClick={() => {
            memberAccountUpdatePage();
          }}
        >
          UPDATE
        </button>
        <button type="button" onClick={handleGoBack}>
          GO BACK
        </button>
      </form>
    </div>
  );
};

export default MyPage;
